import React from 'react';
import { Paralax, ParalaxLayer } from 'react-spring/renderprops-addons'
import './App.css';

function App() {
  return (
    <div>
      <Paralax pages={1} ref={ref => (this.paralax = ref)}>
        <ParalaxLayer offset={1} speed={1} style={{backgroundColor: '#805E73'}} />
      </Paralax>
    </div>
  );
}

export default App;
